const galaxyImageContext = require.context('./images', false, /\.(png|jpe?g|gif|webp|svg)$/);

const galaxyImages = galaxyImageContext.keys().map(galaxyImageContext);

export function getRandomGalaxyImage(fallback) {
  if (!galaxyImages.length) {
    return fallback;
  }
  const index = Math.floor(Math.random() * galaxyImages.length);
  return galaxyImages[index];
}

export default galaxyImages;
